import { Component } from "react";

const styles = {
    layout: {
        backgroundColor: '#fff',
        color: '#0A28E',
        alignItems: 'center',
        justifyContent: 'center',
        display: 'flex',
        gap: '10px'
    }
}

class Layout extends Component{
    render() {
        return (
            <div style={styles.layout}>
                <div>
                    {this.props.children}
                </div>
            </div>
        )
    }
}
export default Layout
